CREATE TABLE `registro_asistencia` (
  `idRegistroAsistencia` int NOT NULL AUTO_INCREMENT,
  `idInstitucion` varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL,
